import React, { Component } from 'react';
// import {Route, BrowserRouter as Router} from 'react-router-dom';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Form from 'react-bootstrap/Form';
import FormControl from 'react-bootstrap/FormControl';

import '../../scss/navbar.scss';

const test = (
  <svg
    width="15"
    height="18"
    viewBox="0 0 15 18"
    fill="none"
    xmlns="http://www.w3.org/2000/svg"
  >
    <g clipPath="url(#clip0)">
      <path
        d="M9.38672 8.31023C10.6611 7.51641 11.5112 6.10242 11.5112 4.49367C11.5112 2.01586 9.4957 0 7.01789 0C4.54008 0 2.52457 2.01586 2.52457 4.49332C2.52457 6.10242 3.37465 7.51605 4.64906 8.30988C1.94133 9.28371 0 11.8772 0 14.9157V17.4554C0 17.7564 0.243633 18 0.544219 18H13.4912C13.7918 18 14.0354 17.7564 14.0354 17.4558V14.9161C14.0354 11.8772 12.0941 9.28406 9.38672 8.31023ZM12.947 16.9112H1.08879V14.9157C1.08879 11.6466 3.74836 8.98699 7.01789 8.98699C10.2871 8.98699 12.947 11.6466 12.947 14.9157V16.9112ZM10.4224 4.49332C10.4224 6.37066 8.89523 7.8982 7.01789 7.8982C5.14055 7.8982 3.61336 6.37066 3.61336 4.49332C3.61336 2.61598 5.14055 1.08879 7.01789 1.08879C8.89523 1.08879 10.4224 2.61598 10.4224 4.49332Z" fill="#fff" />
    </g>
    <defs>
      <clipPath id="clip0">
        <rect width="14.0354" height="18" fill="white" />
      </clipPath>
    </defs>
  </svg>
);


export default class NavBar extends Component {
  render() {
    return (
      <>
        <Navbar collapseOnSelect expand="lg" variant="dark" className="navbar-scss">
          <Navbar.Brand href="#home">Store Name</Navbar.Brand>
          <Navbar.Toggle aria-controls="responsive-navbar-nav" />
          <Navbar.Collapse id="responsive-navbar-nav">
            <Nav className="mr-auto">
              <Nav.Link href="#store">Store</Nav.Link>
              <NavDropdown title="Browse" id="collasible-nav-dropdown">
                <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
                <NavDropdown.Divider />
                <NavDropdown.Item href="#action/3.2">Indie</NavDropdown.Item>
                <NavDropdown.Divider />
                <NavDropdown.Item href="#action/3.3">Adventure</NavDropdown.Item>
                <NavDropdown.Divider />
                <NavDropdown.Item href="#action/3.4">RPG</NavDropdown.Item>
              </NavDropdown>
            </Nav>
            <Form inline>
              <FormControl type="text" placeholder="Search" className=" mr-sm-2" />
            </Form>
            <Navbar.Brand href="#account" className="icon">
              {test}
            </Navbar.Brand>
            {/* <Navbar.Brand href="#favorites" className="icon">
                            <img src={favoritesIcon} alt="favorites icon"/>
                        </Navbar.Brand> */}
            {/* <Navbar.Brand href="#cart">
                            <img src={cartIcon} alt="cart icon" />
                        </Navbar.Brand> */}
          </Navbar.Collapse>
        </Navbar>
      </>
    )
  }
}
